import React from 'react'

const style = {
  height: '500px',
  width: '500px'
}

const ImageList = (props) => {
  return(
    <div>
      {props.pics.map((img, i) => <img style={style} key={i} src={img.urls.regular} alt="pic"></img>)}
    </div>
  )
}

export default ImageList
